(8, 'Request  for submit  accupancy  in time', 'Dear Friends\r\nG-20 SECOND  CULTURE WORKING GROUP MEETING IS GOING TO BE HELD FROM 14.05.2023 TO 17.05.2023 IN BHUBANESWAR .MOVEMENT OF VIPs AND  OTHER DIGNITARIES ARE ALSO BE ANTICIPATED . SOME MISCREANTS / ANTI-SOCIALS   MAY  BE TAKE THEIR SHELTER  IN DIFFERENT HOTELS INSIDE THE BHUBANESWAR CITY DURING  THIS TIME.  PLEASE  SUBMIT YOUR HOTEL OCCUPANCY USING SARAI APP . IF ANY  DIFFICULTIES   NOTICED  THE ISSUE MAY BE  ASKED  TO   SARAI APP I/C IMMEDIATELY.', '2023-05-14 13:27:32', '2023-05-14 13:27:32'),
(9, 'Difficulties  for use of SARAI App', 'Dear friends  if any of you  facing problem  during use of Sarai App please contact  Mr. Bhuban Mohan Samantaray , SI of Police , I/c  Sarai App (9437089378) by call or Whats App.', '2023-05-19 06:41:15', '2023-05-19 06:41:15'),
(10, '', 'ପ୍ରାୟ ଦେଖାଯାଉଛି ଯେ check-in ସମୟ ରେ guest ଙ୍କର ଡାଟା ଏଣ୍ଟ୍ରି କରିବା ବେଳେ  Accompany Details ରେ ଯଦି  guest ଙ୍କ ସାଙ୍ଗରେ କେହି ଥିବେ ତେବେ \"yes\" button press କଲେ  ଆପଣମାନେ କେତେଜଣ Adult ଓ କେତେ ଜଣ Children ବୋଲି value ଦେବେ ଏହାପରେ [Add] button କୁ ପ୍ରେସ କରିବେ ଓ Guest name, select gender, age,  Relatio with Guest ଆଦି ଭରିବାକୁ ପଡ଼ିବ। କିନ୍ତୁ, କିଛି user ଏହା ନକରି କେବଳ value ଯେପରିକି 1 ଦେଇ ଅନ୍ୟ କିଛି ଡାଟା ଦେଉ ନାହାଁନ୍ତି ଓ Check in process କୁ submit କରିଦେଉଛନ୍ତି ଯେଉଁଥି ପାଇଁ Check out ହେଉନାହିଁ । ସେହିବଳି Checkin ସମୟ ରେ room details  ର ମଧ୍ୟ [Add] button press କରି ଠିକ୍ ଭାବରେ ଡାଟା entry କରୁ ନାହାଁନ୍ତି। ଯେଉଁଥି ପାଇଁ Check out ହେଉନାହିଁ। ତେଣୁ ଆପଣ ମାନେ ଏହି ବିଷୟ ପ୍ରତି ଟିକେ ଧ୍ୟାନ ଦେବେ ।', '2023-07-11 15:05:19', '2023-07-11 15:05:19'),
(11, '', 'ବନ୍ଧୁ ମାନେ ବର୍ତ୍ତମାନ SARI App  ରେ ଥିବା ସମସ୍ତ ଅସୁବିଧା ଗୁଡ଼ିକ  ଆମର ପ୍ରିୟ software developer engineer ମାନଙ୍କ ପ୍ରଚେଷ୍ଟା ଓ ସହଯୋଗ ଦ୍ଵାରା ପ୍ରାୟ ଠିକ୍ ଠାକ୍  ହୋଇଯାଇଛି, ଏଥି ପାଇଁ ସେମାନେ ଧନ୍ୟବାଦ୍ ର ପାତ୍ର ଅଟନ୍ତି ଓ ସେମାନଙ୍କୁ ମୁଁ ଅନ୍ତର ର  ସହିତ ଅଭିବାଦନ ଜଣାଉଛି।ଆପଣ ମାନେ ନିଜ ନିଜ ହୋଟେଲ ର ଡାଟା ଗୁଡ଼ିକ ଦିଅନ୍ତୁ ।  ଯଦି କିଛି ଅସୁବିଧା ହେଉଛି ତେବେ ନିମ୍ନ ଲିଖିତ procedure ଗୁଡ଼ିକୁ ଅନୁସରଣ କରନ୍ତୁ। \r\n1. ଯଦି *419। PAGE EXPIRED* message login ପରେ ଆସେ ତେବେ ଆପଣ ମାନେ ତୁରନ୍ତ browser history କୁ ଯାଇ ସମସ୍ତ history କୁ delete କରିଦିଅନ୍ତୁ ଓ ଆଉଥରେ login କରନ୍ତୁ । Sarai App ଠିକ୍ ରେ ଖୋଲିବ।\r\n2. ଯଦି slow ଚାଲୁଛି ତେବେ ନିଜର internet r speed କୁ check କରନ୍ତୁ ।\r\n3. ଯଦି ଅନ୍ୟ କିଛି ଅସୁବିଧା ହେଉଛି ତେବେ ଦୟାକରି ଗ୍ରୁପ୍ ରେ ସଠିକ୍ problem ଟିକୁ ପୋଷ୍ଟ କରନ୍ତୁ।\r\n4. ଏଥିରେ ଯଦି କୌଣସି ଅସୁବିଧା ହେଉଛି, ତେବେ  ବାଣୀବିହାର ଛକ ରେ ଥିବା ଆମ ଅଫିସ କୁ ଆସି ମୋତେ ଦିନ 11 ଟାରୁ 2 ଟା କିମ୍ବା ସନ୍ଧ୍ୟା 6 ଟା ରୁ 8 ଟା ଭିତରେ ଦେଖା କରନ୍ତୁ । ଆସିବା ପୂର୍ବରୁ ଦୟା କରି ଫୋନ୍ କରନ୍ତୁ। ଧନ୍ୟବାଦ୍।', '2023-08-13 18:03:35', '2023-08-13 18:03:35');
